import React from "react";
import colors from "../../config/colors";

import "./Home.css";
import "../../App.css";

function TransacTableRow(props) {
  const {
    srNo,
    sender,
    senderAccountNo,
    receiver,
    receiverAccountNo,
    transferAmt,
    message,
    createdAt,
  } = props;

  // console.log(props.balance);
  return (
    <>
      <tr>
        <th
          scope="row"
          className="text-center"
          // onClick={() => sendMoneyCallback(accountNo, name, balance)}
        >
          {srNo}
        </th>
        {/* <td
          className="text-center"
          // onClick={() => sendMoneyCallback(accountNo, name, balance)}
        >
          {sender}
        </td> */}
        <td
          className="text-center"
          // onClick={() => sendMoneyCallback(accountNo, name, balance)}
        >
          {senderAccountNo}
        </td>
        {/* <td
          className="text-center"
          // onClick={() => sendMoneyCallback(accountNo, name, balance)}
        >
          {receiver}
        </td> */}
        <td
          className="text-center"
          // onClick={() => sendMoneyCallback(accountNo, name, balance)}
        >
          {receiverAccountNo}
        </td>
        <td
          className="text-center"
          // onClick={() => sendMoneyCallback(accountNo, name, balance)}
        >
          {transferAmt}
        </td>
        {/* <td
          className="text-center"
          // onClick={() => sendMoneyCallback(accountNo, name, balance)}
        >
          {message}
        </td> */}
        <td
          className="text-center"
          // onClick={() => sendMoneyCallback(accountNo, name, balance)}
        >
          {createdAt}
        </td>
        {/* <td
          className="text-center"
          // onClick={() => sendMoneyCallback(accountNo, name, balance)}
        >
          {createdAt}
        </td> */}
        <td className="text-center">
          <div
            className="btn text-light"
            style={{ backgroundColor: colors.primary2 }}
            onClick={() => alert("delete clicked")}
          >
            &nbsp;Delete
          </div>
          <div
            className="btn text-light"
            style={{ backgroundColor: colors.secondary2 }}
            onClick={() => alert("invoice clicked")}
          >
            &nbsp;Invoice
          </div>
        </td>
      </tr>
    </>
  );
}

export default TransacTableRow;
